    props.onFetch(url)
  }

  return (
    <div className={classes.header}>
      <div className={classes["search-header"]}>
        <Button onClick = {sentUrlHandlerKpop} name = 'K-pop' className={classes['kpop-button']}/>
        <Button onClick = {sentUrlHandlerOpening} name = 'Openings'className={classes['opening-button']} />
        <Button onClick = {sentUrlHandlerJpop} name = 'J-pop' className={classes['jpop-button']}/>
        <Button onClick = {sentUrlHandlerVgames}name = 'Videogames' className={classes['videogames-button']} />
      </div>
      <div className={classes["user-header"]}>
        <Button className={classes['help-button']}/>
        <Button  className={classes['help-button']}/>
      </div>
    </div>
  );
};

export default Header;
